cs:"Aplikace ChargeUp je slubou typu ESP (E-mobility Service Provider). Jejm clem je propojit provozovatele nabjecch stanic s uivateli slueb elektromobility, tedy idii elektromobil. idim poskytuje monost snadnho nalezen nejbli nabjec stanice a proveden nabjen i bez nutnosti bt registrovan uivatel u vlastnka nabjec stanice. Registrovanm uivatelm poskytuje nstroje pro kontrolu nabjen u elektromobilu ve form notifikacch o ukonenm nabjen, nastaven limit omezujcch vi provedenho nabjen u nabjec stanice. Klovou soust sluby jsou platby za probhl nabjen.",
en:"ChargeUp is an E-mobility Service Provider (ESP). Its aim is to connect the operators of charging stations with users of electromobility services, ie drivers of electric cars. It provides drivers with the ability to easily locate the nearest charging station and perform charging without having to be a registered user at the charging station owner. It provides registered users with tools to control the charging of the electric car in the form of notifications of completed charging, setting limits limiting the amount of charge being charged at the charging station. The key part of the service is payments for charging.",
sk:"Aplikcia ChargeUp je slubou typu ESP (E-mobility Service Provider). Jej cieom je prepoji prevdzkovatea nabjacch stanc s pouvatemi sluieb elektromobility, teda vodimi elektromobilov. Vodiom poskytuje monos jednoduchho njdenia najbliej nabjacej stanice a prevedenia nabjania aj bez nutnosti by registrovanm pouvateom u vlastnka nabjacej stanice. Registrovanm pouvateom poskytuje nstroje na kontrolu nabjania elektromobilu vo forme notifikci o ukonenom nabjan i nastavenie limitov obmedzujcich objem vykonanho nabjania na nabjacej stanici. Kovou sasou sluby s platby za uskutonen nabitia.",
de:"Die ChargeUp-App ist ein ESP-Dienst (E-Mobility Service Provider). Ziel ist es, Ladestationsbetreiber mit Nutzern von Elektromobilittsdiensten, dh Fahrern von Elektrofahrzeugen, zu verbinden. Sie bietet Fahrern die Mglichkeit, die nchstgelegene Ladestation leicht zu finden und Laden durchzufhren, ohne ein registrierter Benutzer sein zu mssen. Es bietet registrierten Benutzern Instrumente zur Steuerung des Ladevorgangs eines Elektrofahrzeugs in Form von Benachrichtigungen ber den abgeschlossenen Ladevorgang, wobei Grenzwerte festgelegt werden, die die an der Ladestation durchgefhrte Ladungsmenge begrenzen. Wichtiges Service ist Zahlungen fr abgeschlossene Aufladung.",
uk:"ChargeUp     (ESP).   -         ,   .                     .               ,  ,    ,     .        .",
sv:"ChargeUp r en leverantr fr mobilitetstjnster (ESP). Mlet r att ansluta operatrerna av laddstationer till anvndare av mobilitetstjnster, det vill sga frare av elbilar. Den ger frare mjlighet att enkelt hitta nrmaste laddningsstation och ladda utan att behva vara registrerad anvndare hos garen av laddningsstationen. Den ger registrerade anvndare verktyg fr att styra laddningen av elbilen i form av meddelanden om avslutad laddning, och stter grnser fr hur mycket som laddas vid laddningsstationen. En av tjnstens huvudsakliga syfte r betalning av avgifter."
